INSERT INTO `playlists` (`id`, `spotifyId`, `name`, `description`, `trackCount`, `followers`) VALUES
(1, '37i9dQZF1DX1328t2iygZy', 'The Refugee Playlist', 'In a world that welcomes refugees, we get world-changing music from artists like these. Act at rescue. org <a href=\"https://www.rescue.org/article/how-help-refugees-united-states\">here</a>', 22, 16084),
(2, '37i9dQZF1DX1wvY0jqbS55', 'This Is: Jason Isbell', 'Get to know Jason Isbell with a collection of essentials.', 49, 11378),
(3, '37i9dQZF1DWVs8I62NcHks', 'This Is: Disney', 'All of your favorite Disney classics, new and old..', 58, 249444),
(4, '37i9dQZF1DX95gx8SY6DLX', 'This Is: The Doors', 'Unique, magnetic, and provocative, <a href=\"spotify:artist:22WZ7M8sxp5THdruNY3gXt\">they</a> were among the most controversial and influential rock acts of the \'60s.', 50, 83112),
(5, '37i9dQZF1DXec50AjHrNTq', 'This Is: AC/DC', 'Founder of AC/DC Malcolm Young (1953-2017) R.I.P.', 35, 523790),
(6, '37i9dQZF1DWZUozJiHy44Y', 'This Is: Adele', 'All of Adele\'s essential songs, all in one place. This is Adele.', 25, 529363),
(7, '37i9dQZF1DWZMCPjHG57gq', 'This Is: Al Green', 'This is the essential collection of songs from the legendary soul singer, Al Green!', 26, 27259),
(8, '37i9dQZF1DWXMmak2OV7PN', 'This Is: alt-J', 'Marking the arrival of new album \'Relaxer\' and showcasing the best of their work so far - This Is: alt-J.', 23, 62500),
(9, '37i9dQZF1DX3reMgdkcDa4', 'This Is: Aqua', 'Twenty years since \'Barbie Girl\' took over the world, we revisit the best from the Danish pop powerhouse - This is Aqua.', 21, 7381),
(10, '37i9dQZF1DX6bJVMtDYJHx', 'This is: Aretha Franklin', 'One of the most honored artists in Grammy history (18 awards) and the first female artist to be inducted into the Rock and Roll Hall of Fame. This is Aretha Franklin.', 50, 27151),
(11, '37i9dQZF1DWZvGllBOMzci', 'This Is: Bee Gees', 'Defining disco and making pop classics which span the decades - This is: Bee Gees. You should be dancing, yeah?', 52, 119096),
(12, '37i9dQZF1DX4EKARgqYPFZ', 'This Is: blink-182', 'The SoCal legends went all the way to the top with a pop punk sound all their own...This is blink-182.', 65, 130571),
(13, '37i9dQZF1DWY5M5bfaAf3t', 'This is: Bronzeville', 'Music inspired by the Bronzeville Audio Drama. Check out the series <a href=\"http://spoti.fi/2kIfnPQ\">here </a>', 25, 5153),
(14, '37i9dQZF1DX177vQ7mVRmP', 'This Is: Bruno Mars', 'Check out this collection of hits from Bruno Mars, including the brand new album, 24K Magic!', 38, 1226867),
(15, '37i9dQZF1DX6GiJlVeD6Ou', 'This is: Carole King', 'One of pop music\'s most gifted and successful composers of all time, celebrating her 75th birthday today. Happy Birthday Carole King!', 50, 11872),
(16, '37i9dQZF1DX5WtNRbfbuUo', 'This is: Deep Purple', 'Five guys from Hertford/UK, who are considered as the pioneers of the genres Modern Hard Rock and Metal. This is: Deep Purple', 50, 44718),
(17, '37i9dQZF1DX3BSwupE5hR7', 'This Is: Depeche Mode', '<a href=\"spotify:artist:762310PdDnwsDxAQxzQkfX\">Masters and servants</a> of the British electronic pop craze of the ‘80s. Since then, they’ve enjoyed worldwide success.', 53, 97589),
(18, '37i9dQZF1DWVRrLXgTbWFy', 'This Is: Dispatch', 'This is: Dispatch. The essential tracks, all in one playlists.', 35, 6575),
(19, '37i9dQZF1DWWxPM4nWdhyI', 'This Is: Ed Sheeran', 'A collection of Ed\'s best hits. This Is: Ed Sheeran', 39, 2168868),
(20, '37i9dQZF1DWVstK6FYh8Nw', 'This Is: Future', 'Some of Future\'s dopest songs plus new bangers from Super Slimey', 40, 267783),
(21, '37i9dQZF1DXcIVSTUG9zAG', 'This Is: George Michael', 'Listen to a collection of his greatest hits. This Is: George Michael', 50, 169093),
(22, '37i9dQZF1DWUifRttnt99X', 'This is: Gillian Welch', 'An essential collection of songs from folk icon, <a href=\"spotify:artist:2H5elA2mJKrHmqkN9GSfkz\">Gillian Welch</a>.', 49, 6131),
(23, '37i9dQZF1DX3Csy1LFxjkI', 'This Is: James Arthur', 'Listen to all of James Arthur\'s biggest songs and Say You Won\'t Let Go. This Is: James Arthur.', 19, 115853),
(24, '37i9dQZF1DX9OTdoPfdJpF', 'This is: Jamiroquai', 'Check out \'Automaton\' and all of the hits. You know their boogie is for real - This is: <a href=\"spotify:artist:6J7biCazzYhU3gM9j1wfid\">Jamiroquai</a>', 64, 61750),
(25, '37i9dQZF1DWYrlaUEYy4Vg', 'This Is: John Mayer', 'All of John Mayer\'s greatest songs, including &quot;Helpless&quot; from the second wave of &quot;The Search For Everything&quot;.', 58, 172372),
(26, '37i9dQZF1DX8DxW4iib3Eq', 'This Is: John Legend', 'Check out this collection of amazing John Legend tracks, including his newest release, DARKNESS AND LIGHT!', 37, 90016),
(27, '37i9dQZF1DXc2aPBXGmXrt', 'This Is: Justin Bieber', 'The <a href=\"spotify:artist:1uNFoZAHBGtllmzznpCI3s\">artist</a> has smashed records in the wake of his move from teen idol to global pop phenomenon.', 49, 1016762),
(28, '37i9dQZF1DXc7FZ2VBjaeT', 'This Is: Lady Gaga', 'There\'s a \'Million Reasons\' to listen... This Is: Lady Gaga, featuring all of her biggest hits!', 35, 254484),
(29, '37i9dQZF1DX1xlmTNXq2Qg', 'This Is: LANY', 'We love them (so bad, so bad). This is LANY.', 32, 161216),
(30, '37i9dQZF1DX3Hdbt1R3mYP', 'This Is: Laura Marling', 'One of the most important British folk artists of the 21st century. This is Laura Marling', 35, 7425),
(31, '37i9dQZF1DWULYh276RumE', 'This Is:  Miranda Lambert', 'A retrospective of Miranda\'s career in music.', 57, 47948),
(32, '37i9dQZF1DWTG97QsiXgEX', 'This Is: Muse', 'This is the essential Muse.', 36, 100139),
(33, '37i9dQZF1DWT6VDwxLyl0W', 'This is: Neil Young', 'Follow the muse of a master and enjoy over 50 years of musical genius. This is Neil Young.', 50, 61116),
(34, '37i9dQZF1DX8OYzU0lx5hL', 'This Is: Nina Simone', 'One of the finest voices we\'ve ever known...This Is: Nina Simone.', 50, 59528),
(35, '37i9dQZF1DWThFkopzOaNW', 'This Is: New Edition', 'Celebrate the career of one of the best and most influential R&amp;B groups of all time....New Edition!!!!!', 46, 51374),
(36, '37i9dQZF1DX6p4TJxzMRDe', 'This Is: One Direction', 'Dance all night to the best songs ever. This Is: One Direction.', 50, 307321),
(37, '37i9dQZF1DXbZBKpgxsyXU', 'This Is: OneRepublic', 'I won\'t Apologize, I don\'t care if they Stop And Stare. I want the Good Life to Feel Again...to know I Lived with no Secrets, Wherever I Go...This is OneRepublic.', 32, 98735),
(38, '37i9dQZF1DX4dWEvmDfGoP', 'This is: Raffi', 'An essential introduction to Raffi.', 50, 4706),
(39, '37i9dQZF1DX6JzJ8vAK836', 'This Is: Prince', 'Dearly beloved, we are gathered here today to celebrate the life and music of his Purple Highness, Prince Rogers Nelson!', 69, 373476),
(40, '37i9dQZF1DWXqcBHh7a68E', 'This Is: Rag\'n\'Bone Man', 'Listen to \'Human\', the new album from Rag\'n\'Bone Man alongside other career highlights.', 31, 71988),
(41, '37i9dQZF1DX024QaIPhrkq', 'This Is: Soundgarden', 'Never to be outshined, the legacy of Chris Cornell will live on forever. His inimitable voice and music changed a generation and beyond.', 51, 42423),
(42, '37i9dQZF1DX1zj9CzXszqD', 'This Is: Status Quo', 'A collection of the essential Status Quo songs. Rest in peace Rick Parfitt.', 43, 9758),
(43, '37i9dQZF1DWWYIyS8LLUDj', 'This Is: Stevie Wonder', 'Soul, pop, R&B, jazz—it’s all at the fingertips of <a href=\"spotify:artist:7guDJrEfX3qb6FEbdPA5qi\">Stevland Morris</a> from Saginaw, MI, the musical wonder who made his recording debut at 11.', 50, 61974),
(44, '37i9dQZF1DXaZan2kzvaVc', 'This Is: The Beach Boys', 'The <a href=\"spotify:artist:3oDbviiivRWhXwIE8hxkVV\">group</a> from Hawthorne, CA, redefined pop with experimental production and vocal harmonies that have rarely been rivaled.', 50, 34945),
(45, '37i9dQZF1DX5COO9vTaRpO', 'This Is: The Rolling Stones', 'The legendary <a href=\"spotify:artist:22bE4uQ6baNwSHPVcDxLCe\">rock band</a>\'s essential tracks, all in 1 playlist.', 50, 229524),
(46, '37i9dQZF1DX6bnzK9KPvrz', 'This Is: The Weeknd', 'Check out this collection of The Weeknd\'s dopest tracks!', 44, 928004),
(47, '37i9dQZF1DXctzlWgrxNLn', 'This Is:  Thomas Rhett', 'Take a listen to Thomas Rhett\'s music - along with hit songs he\'s written for other artists.  Here is new song \"Unforgettable\"!', 44, 66840),
(48, '37i9dQZF1DX5xFQkXoZxdM', 'This Is: Trey Songz', 'This is the essential collection of songs from Trey Songz, including his newest release, &quot;Tremaine The Album&quot;.', 41, 85782),
(49, '37i9dQZF1DX8f6VxHEcGCN', 'This Is: Bob Dylan', 'The career of Nobel Literature Prize winning Robert Allen Zimmerman is breathtaking. Here\'s some of the most memorable songs to get you started.', 75, 118248),
(50, '37i9dQZF1DWZais6SIaMts', 'This Is: Bonobo', 'A genre-redefining producer, composer and DJ. This Is: <a href=\"https://open.spotify.com/artist/0cmWgDlu9CwTgxPhf403hb\">Bonobo </a>', 43, 48663),
(51, '37i9dQZF1DWXcA2XXbXQ3d', 'This Is: Britney Spears', 'As Britney Jean Spears cements her iconic status with her new studio album, check out choice selections from \'Glory\' and her definitive career cuts.', 45, 156926),
(52, '37i9dQZF1DX9qkL85stcHs', 'This is: Bruce Springsteen', 'A singer-songwriter with working class roots from N.J, who became a world wide arena rock star. This is Bruce Frederick Joseph Springsteen.', 54, 54085),
(53, '37i9dQZF1DX3w9f3pg1Dyc', 'This is: Cher', 'Singer, actress, songwriter, dancer, model, fashion designer, television host, comedian, philanthropist, author, film producer,record producer. This is: Cher', 36, 35712),
(54, '37i9dQZF1DX0LonJ1uN97e', 'This is: Chuck Berry', 'The most influential performer of them all in rhythm-and-blues + rock \'n\' roll music, and the sole &quot;father of rock \'n\' roll”. R.I.P. Chuck Berry', 60, 31365),
(55, '37i9dQZF1DWZAkrucRF6Gq', 'This Is: Daft Punk', 'Celebrated masters of \'French touch\', blending electro elegance with cutting edge disco - This Is: Daft Punk.', 30, 171015),
(56, '37i9dQZF1DX9AUVnnnNUND', 'This Is: Eagles', 'With 5 No. 1 singles, 14 Top 40 hits, and 4 No. 1 albums, the <a href=\"spotify:artist:0ECwFtbIWEVNwjlrfc6xoL\">band</a> remains one of the most successful of the ‘70s.', 45, 162593),
(57, '37i9dQZF1DX3yvjXSVJwJV', 'This Is: Earth, Wind & Fire', 'In honor of Maurice White\'s memory, we present This Is: Earth, Wind &amp; Fire. Rest In Paradise, Sir!', 24, 83624),
(58, '37i9dQZF1DX7VulteLVOkq', 'This Is: Elton John', 'Still standing after all these years. Here are some of the many highlights from the <a href=\"spotify:artist:3PhoLpVuITZKcymswpck5b\">Rocket Man</a>\'s glittering career.', 41, 132863),
(59, '37i9dQZF1DXdRITMyVwc9y', 'This is: Emeli Sandé', 'Read all about it. Her biggest hits and new music as it arrives. This is Emeli Sandé.', 26, 14138),
(60, '37i9dQZF1DWSxQLa5KoDYW', 'This Is: Gorillaz', 'Listen to the <a href=\"spotify:artist:3AA28KZvwAUcZuOKwyblJQ\">group\'s</a> latest album, Humanz, and a selection of their best known hits.', 40, 249283),
