(246, '37i9dQZF1DWTMR78LDoAZC', 'Alternative Pride', 'Perfume Genius and ANOHNI are just a few of the shining standouts in this Pride spectrum of alternative and indie artists. Cover: Beth Ditto', 50, 49755),
(247, '37i9dQZF1DWX82ahbDuQIz', 'Best of Broadway', 'We’re bringing the drama to Pride and pulling our favorite tracks from the best in American musical theater. Cover: Idina Menzel', 50, 129840),
(248, '37i9dQZF1DXbmCTvLQy5AO', 'Work It, Own It', 'It doesn’t get any realer—queer hip-hop artists are finding their own ferocious flow and spittin’ their truths for Pride. Cover: Young M.A.', 46, 24414),
(249, '37i9dQZF1DWZZCoBbLu26P', 'Fierce', 'Yas, queens. Sparkle, sass, and clash with the utmost style to this Pride playlist of drag club classics and prismatic beats. Cover: Big Freedia', 31, 15988),
(250, '37i9dQZF1DX5TMFhaZc9ov', 'Queer As Folk', 'Sing out as LGBTQIA+ performers and allies keep it intimate and pull out the acoustics. Cover: Ani Difranco', 50, 13178),
(251, '37i9dQZF1DWTLrNDPW5co2', 'In Electric Dreams', 'Let the beat take control. We\'re plugging into the best electronic and dance sounds for Pride. Cover: Hercules & Love Affair', 68, 50929),
(252, '37i9dQZF1DX2GKumqRIZ7g', 'Disco Fever', 'We’re burning up—and killing it on the dance floor to these four-on-the-floor Pride classics. Cover: Chic', 50, 138841),
(253, '37i9dQZF1DWZTHlwqNeZ4l', 'Tegan and Sara: Pride', 'Tapping Gallant, ANOHNI, and more, the Canadian duo forge a Pride list that defines eclecticism. Listen for a new tune with Ingrid Michaelson.', 27, 12167);
